import { AnnotationMember } from '../../entities/AnnotationMember';
import { Annotation } from '../../entities/Annotation';
import { User } from '../../entities/User';
import { throwError } from '../../../../../shared/errors';
import { TIMESTAMP } from '../../util/timestamps';

const addAnnotationMember = async (p, args, context) => {
  const { input } = args;
  const annotation = await Annotation.buildFromId(input.annotationId, context?.user?.id, 'Mutation.addAnnotationMember', context);
  const user = await User.buildFromId(input.userId, 'Mutation.editAnnotationMember', context);
  const member = await annotation.addMember(user);
  return member.resolveAsEntity();
};

const editAnnotationMember = async (p, args, context) => {
  const { annotationId, userId, input } = args;
  const annotation = await Annotation.buildFromId(annotationId, userId, 'Mutation.editAnnotationMember', context);
  if (!annotation) {
    throwError('Mutation.editAnnotationMember', '[Annotation] Entity not found.');
  }
  const member = await AnnotationMember.buildFromId({ annotationId, userId }, 'Mutation.editAnnotationMember', context);
  if (!member) {
    throwError('Mutation.editAnnotationMember', '[AnnotationMember] Entity not found.')
  }
  await member.setMultiple(input);
  await member.save();

  annotation.publishEvent(context.pubsub, 'EDIT', {
    onlyFireForUserId: userId,
  });

  return member.resolveAsEntity();
};

const updateAnnotationMemberLastRead = async (p, args, context) => {
  const { annotationId, userId } = args;
  let annotation: Annotation;
  try{
    annotation = await Annotation.buildFromId(
      annotationId,
      userId,
      'Mutation.updateAnnotationMemberLastRead',
      context
    );
  } catch (e) {
    //do nothing
  }

  if (!annotation) { //inserted annotations(signatures etc) get selected before created
    return {
      __typename: 'AnnotationNotFound',
      message: 'Annotation not found',
      annotationId
    };
  }
  const authorId = await annotation.get('authorId');
  if (!authorId) {
    return {
      __typename: 'IgnoreMembership',
      message: 'Ignore membership for imported annotations',
      annotationId
    };
  }

  const { updatedMember, markedAsRead } = await annotation.markAsRead(userId);

  annotation.publishEvent(context.pubsub, 'EDIT', {
    markedAsRead,
    onlyFireForUserId: userId,
  });

  return updatedMember.resolveAsEntity();
}

const deleteAnnotationMember = async (p, args, context) => {
  const { memberId, userId, annotationId } = args.input;
  const annotMember = await AnnotationMember.buildFromId({ memberId, userId, annotationId }, 'Mutation.deleteAnnotationMember', context);
  if(!annotMember){
    throwError('Mutation.deleteAnnotationMember', '[AnnotationMember] Entity not found.');
  }
  return annotMember.delete();
};

export default { addAnnotationMember, editAnnotationMember, updateAnnotationMemberLastRead, deleteAnnotationMember };
